import React, { useContext } from 'react';
import { AuthContext } from './AuthContext';

const Home = () => {
  const { isLoggedIn } = useContext(AuthContext);

  return (
    <div>
      {isLoggedIn ? 'You are logged in!' : 'You are not logged in.'}
    </div>
  );
};

export default Home;
